import{o as e,c as r,d as o}from"./app.b33347b1.js";const i='{"title":"FAQ","description":"","frontmatter":{},"headers":[{"level":2,"title":"FAQ","slug":"faq"}],"relativePath":"faq.md","lastUpdated":1623340671671}',t={},a=o('<h2 id="faq"><a class="header-anchor" href="#faq" aria-hidden="true">#</a> FAQ</h2><h4 id="does-any-server-side-software-need-to-be-installed"><a class="header-anchor" href="#does-any-server-side-software-need-to-be-installed" aria-hidden="true">#</a> Does any server side software need to be installed?</h4><p>For most of the Succeedium functionality no server side software is required to install. However if you install <strong>Succeedium Agent</strong> you will get additional features, like server health status data (RAM, CPU, disk size)</p><h4 id="will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers"><a class="header-anchor" href="#will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" aria-hidden="true">#</a> Will any of my data be sent or stored on any 3rd party servers?</h4><p>Succeedium stores temporary data using <a href="https://en.wikipedia.org/wiki/HTTP_cookie" target="_blank" rel="noopener noreferrer">cookies</a>. No data is being sent or stored on any servers.</p><h4 id="which-tm1-integratedsecuritymode-does-succeedium-support"><a class="header-anchor" href="#which-tm1-integratedsecuritymode-does-succeedium-support" aria-hidden="true">#</a> Which TM1 IntegratedSecurityMode does Succeedium support?</h4><p>Succeedium supports the next TM1 integrated security modes: 1, 4, 5. If you don&#39;t specify <strong>namespace</strong> property of your environment definition, it will use mode 1 for connecting to TM1.</p><h4 id="succeedium-add-on-not-working-dev-console-displays-we-re-sorry-a-server-error-occurred-while-reading-from-storage-error-code-permission-denied"><a class="header-anchor" href="#succeedium-add-on-not-working-dev-console-displays-we-re-sorry-a-server-error-occurred-while-reading-from-storage-error-code-permission-denied" aria-hidden="true">#</a> Succeedium add-on not working. Dev console displays: We&#39;re sorry, a server error occurred while reading from storage. Error code PERMISSION_DENIED.?</h4><p>This is a random error when trying to access Google script functions. Try the following to resolve it:</p><ul><li>re-open your Google sheet and try opening Succeedium sidebar or Succeedium Code again</li><li>re-login to your Google account, re-open your Google sheet and try opening Succeedium sidebar or Succeedium Code again</li></ul><h4 id="succeedium-add-on-not-working-in-incognito-window"><a class="header-anchor" href="#succeedium-add-on-not-working-in-incognito-window" aria-hidden="true">#</a> Succeedium add-on not working in incognito window</h4><p>You may also see the next error in Dev console: Error in v-on handler: &quot;SecurityError: Failed to read the &#39;localStorage&#39; property from &#39;Window&#39;: Access is denied for this document.&quot; Succeedium add-on is using cookies and it may be blocked by your browser, for instance under Chrome&#39;s Settings &gt; Privacy &gt; Content settings, you have the cookie setting set to &quot;Block sites from setting any data&quot;</p><hr><p>SucceediumÂ® 2021 | <a href="/contact.html">Contact Us</a> | <a href="/privacy.html">Privacy Policy</a> | <a href="/terms.html">Terms Of Service</a></p>',14);t.render=function(o,i,t,n,s,d){return e(),r("div",null,[a])};export default t;export{i as __pageData};
